    false,nt"url": null,nt"notes": "This environmental assessment outlines
    how the United States Fish and Wildlife Service proposes to open the Wallkill River
    National Wildlife Refuge for a managed balance of wildlife-dependent public recreational
    activities. Wildlife observation and photography, environmental education and interpretation,
    hunting, sport fishing, and trapping programs would be established or expanded.
    To accomplish these objectives, refuge-specific regulations would be enacted to
    ensure safety, practice sound management, comply with legal mandates, and ensure
    compatibility with the objectives for which the refuge was established.",nt"owner_org":
